-- ----------------------------
-- Table structure for Portfele_inwestycyjne
-- ----------------------------
DROP TABLE IF EXISTS `Portfele_inwestycyjne`;
CREATE TABLE `Portfele_inwestycyjne`  (
  `ID_portfela` int(11) NOT NULL AUTO_INCREMENT,
  `ID_klienta` int(11) NOT NULL,
  `Nazwa_portfela` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `Typ_portfela` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `Saldo_portfela` decimal(15, 2) NOT NULL,
  `Data_otwarcia` date NOT NULL,
  PRIMARY KEY (`ID_portfela`) USING BTREE,
  INDEX `ID_klienta_portfele`(`ID_klienta` ASC) USING BTREE,
  INDEX `Typy_portfeli`(`Typ_portfela` ASC) USING BTREE,
  CONSTRAINT `ID_klienta_portfele` FOREIGN KEY (`ID_klienta`) REFERENCES `klienci` (`ID_klienta`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `Typy_portfeli` FOREIGN KEY (`Typ_portfela`) REFERENCES `Typy_portfeli_inwestycyjnych` (`Nazwa_typu`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 1103 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci;

