-- ----------------------------
-- Table structure for Pracownicy
-- ----------------------------
DROP TABLE IF EXISTS `Pracownicy`;
CREATE TABLE `Pracownicy`  (
  `ID_pracownika` int(11) NOT NULL AUTO_INCREMENT,
  `ID_Adresu` int(11) NULL DEFAULT NULL,
  `Stanowisko` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL,
  `Login` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `Haslo` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `Imie` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `Nazwisko` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `Data_urodzenia` date NULL DEFAULT NULL,
  `Adres_email` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  PRIMARY KEY (`ID_pracownika`) USING BTREE,
  INDEX `ID_adresu_pracownicy`(`ID_Adresu` ASC) USING BTREE,
  INDEX `Stanowiska`(`Stanowisko` ASC) USING BTREE,
  CONSTRAINT `ID_adresu_pracownicy` FOREIGN KEY (`ID_Adresu`) REFERENCES `Adresy_zamieszkania` (`ID_Adresu`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `Stanowiska` FOREIGN KEY (`Stanowisko`) REFERENCES `Stanowiska` (`Stanowisko`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 102 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci;

