-- ----------------------------
-- Table structure for Pytania_do_wsparcia
-- ----------------------------
DROP TABLE IF EXISTS `Pytania_do_wsparcia`;
CREATE TABLE `Pytania_do_wsparcia`  (
  `ID_konwersacji` int(11) NOT NULL AUTO_INCREMENT,
  `ID_klienta` int(11) NOT NULL,
  `ID_pracownika` int(11) NOT NULL,
  `ID_transakcji` int(11) NOT NULL,
  `Tresc_wiadomosci` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `Data_wyslania` datetime NOT NULL,
  `Status` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  PRIMARY KEY (`ID_konwersacji`) USING BTREE,
  INDEX `Status_Wiadomości`(`Status` ASC) USING BTREE,
  INDEX `ID_klienta_pytania`(`ID_klienta` ASC) USING BTREE,
  INDEX `ID_pracownika_pytania`(`ID_pracownika` ASC) USING BTREE,
  INDEX `ID_transakcji`(`ID_transakcji` ASC) USING BTREE,
  INDEX `text`(`Tresc_wiadomosci` ASC) USING BTREE,
  CONSTRAINT `ID_klienta_pytania` FOREIGN KEY (`ID_klienta`) REFERENCES `klienci` (`ID_klienta`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `ID_pracownika_pytania` FOREIGN KEY (`ID_pracownika`) REFERENCES `Pracownicy` (`ID_pracownika`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `ID_transakcji` FOREIGN KEY (`ID_transakcji`) REFERENCES `Transakcje` (`ID_transakcji`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `Status_Wiadomości` FOREIGN KEY (`Status`) REFERENCES `Status_Wiadomości` (`Typ_Statusu`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `status_check` CHECK (`Status` in ('Nieprzeczytane','Przeczytane'))
) ENGINE = InnoDB AUTO_INCREMENT = 51 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci;

