-- ----------------------------
-- View structure for Byli_klienci
-- ----------------------------
DROP VIEW IF EXISTS `Byli_klienci`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Byli_klienci` AS select `klienci`.`ID_klienta` AS `ID_klienta`,`klienci`.`Imie` AS `Imie`,`klienci`.`Nazwisko` AS `Nazwisko`,`klienci`.`Numer_telefonu` AS `Numer_telefonu`,`klienci`.`Adres_email` AS `Adres_email`,`klienci`.`row_start` AS `Data_zalozenia_konta`,`klienci`.`row_end` AS `Data_zamkniecia_konta` from `klienci` FOR SYSTEM_TIME ALL where `klienci`.`row_end` < current_timestamp();

-- ----------------------------
-- View structure for Klienci_z_adresami
-- ----------------------------
DROP VIEW IF EXISTS `Klienci_z_adresami`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Klienci_z_adresami` AS select `klienci`.`ID_klienta` AS `ID_klienta`,`klienci`.`Imie` AS `Imie`,`klienci`.`Nazwisko` AS `Nazwisko`,`klienci`.`Numer_telefonu` AS `Numer_telefonu`,`klienci`.`Data_urodzenia` AS `Data_urodzenia`,`a`.`Panstwo` AS `Panstwo`,`a`.`Miasto` AS `Miasto`,`a`.`Kod_pocztowy` AS `Kod_pocztowy`,`a`.`Ulica` AS `Ulica`,`a`.`Nr_budynku` AS `Nr_budynku`,`a`.`Nr_lokalu` AS `Nr_lokalu` from (`klienci` join `Adresy_zamieszkania` `a` on(`a`.`ID_Adresu` = `klienci`.`ID_Adresu`));

-- ----------------------------
-- View structure for Liczba_pracownikow_na_stanowiskach
-- ----------------------------
DROP VIEW IF EXISTS `Liczba_pracownikow_na_stanowiskach`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Liczba_pracownikow_na_stanowiskach` AS select `Pracownicy`.`Stanowisko` AS `Stanowisko`,count(0) AS `Liczba_Pracownikow` from `Pracownicy` group by `Pracownicy`.`Stanowisko`;

-- ----------------------------
-- View structure for Procent_sumy_sald_klientow_danego_panstwa_wzgledem_calosci
-- ----------------------------
DROP VIEW IF EXISTS `Procent_sumy_sald_klientow_danego_panstwa_wzgledem_calosci`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Procent_sumy_sald_klientow_danego_panstwa_wzgledem_calosci` AS select `a`.`Panstwo` AS `Panstwo`,concat(round(sum(`p`.`Saldo_portfela`) / (select sum(`Portfele_inwestycyjne`.`Saldo_portfela`) from `Portfele_inwestycyjne`) * 100,2),'%') AS `Procent` from ((`Portfele_inwestycyjne` `p` join `klienci` `k` on(`p`.`ID_klienta` = `k`.`ID_klienta`)) join `Adresy_zamieszkania` `a` on(`a`.`ID_Adresu` = `k`.`ID_Adresu`)) group by `a`.`Panstwo`;

-- ----------------------------
-- View structure for Suma_sald_portfeli
-- ----------------------------
DROP VIEW IF EXISTS `Suma_sald_portfeli`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Suma_sald_portfeli` AS select `Portfele_inwestycyjne`.`ID_klienta` AS `ID_klienta`,sum(`Portfele_inwestycyjne`.`Saldo_portfela`) AS `Suma_sald_portfeli` from `Portfele_inwestycyjne` group by `Portfele_inwestycyjne`.`ID_klienta`;

-- ----------------------------
-- View structure for Zwolnieni_pracownicy
-- ----------------------------
DROP VIEW IF EXISTS `Zwolnieni_pracownicy`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `Zwolnieni_pracownicy` AS select `Pracownicy`.`Imie` AS `Imie`,`Pracownicy`.`Nazwisko` AS `Nazwisko`,`Pracownicy`.`Stanowisko` AS `Stanowisko`,`Pracownicy`.`Adres_email` AS `Adres_email`,`Pracownicy`.`row_start` AS `Data_zatrudnienia`,`Pracownicy`.`row_end` AS `Data_zwolnienia` from `Pracownicy` FOR SYSTEM_TIME ALL where `Pracownicy`.`row_end` < current_timestamp() and `Pracownicy`.`Stanowisko` is not null;

-- ----------------------------
-- Procedure structure for aktualizuj_historie_ceny_danego_instrumentu
-- ----------------------------
DROP PROCEDURE IF EXISTS `aktualizuj_historie_ceny_danego_instrumentu`;
delimiter ;;
CREATE PROCEDURE `aktualizuj_historie_ceny_danego_instrumentu`(IN vID_instrumentu INT)
BEGIN
		DELETE FROM Historia_cen_danego_instrumentu;
    INSERT INTO Historia_cen_danego_instrumentu (ID_historia_ceny, ID_instrumentu, Data, Cena)
    SELECT ID_historia_ceny, ID_instrumentu, Data, Cena
    FROM Historia_cen_instrumentow
    WHERE ID_instrumentu = vID_instrumentu;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for dodaj_adres
-- ----------------------------
DROP FUNCTION IF EXISTS `dodaj_adres`;
delimiter ;;
CREATE FUNCTION `dodaj_adres`(IN `vPanstwo` varchar(80),IN `vMiasto` varchar(50),IN `vKod_pocztowy` varchar(10),IN `vUlica` varchar(50),IN `vNr_budynku` varchar(10),IN `vNr_lokalu` varchar(10))
 RETURNS int(11)
BEGIN 
	DECLARE id_adresu_max INT DEFAULT 0;

	INSERT INTO Adresy_zamieszkania (Panstwo, Miasto, Kod_pocztowy, Ulica, Nr_budynku, Nr_lokalu)
				 VALUES (vPanstwo, vMiasto, vKod_pocztowy, vUlica, vNr_budynku, vNr_lokalu);
				 
	SELECT MAX(ID_Adresu) INTO id_adresu_max FROM Adresy_zamieszkania;
	
	
	RETURN id_adresu_max;
	
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for dodaj_instrument
-- ----------------------------
DROP PROCEDURE IF EXISTS `dodaj_instrument`;
delimiter ;;
CREATE PROCEDURE `dodaj_instrument`(IN `vNazwa_instrumentu` varchar(100), IN `vTyp_instrumentu` varchar(50), IN `vCena_aktualna` DECIMAL(15,2), IN `vData_aktualizacji_ceny` datetime)
BEGIN

	if(char_length(vNazwa_instrumentu)>0) then
	INSERT INTO Instrumenty_finansowe(Nazwa_instrumentu, Typ_instrumentu, Cena_aktualna, Data_aktualizacji_ceny)
	VALUES (vNazwa_instrumentu, vTyp_instrumentu, vCena_aktualna, vData_aktualizacji_ceny);
	end if;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for dodaj_klienta
-- ----------------------------
DROP PROCEDURE IF EXISTS `dodaj_klienta`;
delimiter ;;
CREATE PROCEDURE `dodaj_klienta`(IN `vLogin` varchar(50),IN `vHaslo` varchar(255),IN `vImie` varchar(50),IN `vNazwisko` varchar(50),IN `vNumer_telefonu` varchar(15), IN `vData_urodzenia` date, IN `vAdres_email` varchar(100), IN `vPanstwo` varchar(80),IN `vMiasto` varchar(50),IN `vKod_pocztowy` varchar(10),IN `vUlica` varchar(50),IN `vNr_budynku` int(11),IN `vNr_lokalu` int(11))
BEGIN
	DECLARE id_adresu INT(11);
	
	SET id_adresu = dodaj_adres(vPanstwo, vMiasto, vKod_pocztowy, vUlica, vNr_budynku, vNr_lokalu);
	if(char_length(vLogin)>0 and char_length(vHaslo)>0 and char_length(vImie)>0 and char_length(vNazwisko)>0 and char_length(vNumer_telefonu)>0 and char_length(vAdres_email)>0 and char_length(vPanstwo)>0 and char_length(vMiasto)>0 and char_length(vKod_pocztowy)>0 and char_length(vUlica)>0) then
	
	INSERT INTO klienci (Login, Haslo, Imie, Nazwisko, ID_Adresu, Numer_telefonu, Data_urodzenia, Adres_email) VALUES (vLogin, vHaslo, vImie, vNazwisko, id_adresu, vNumer_telefonu,
											 vData_urodzenia, vAdres_email);
											 
	 end if;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for dodaj_portfel
-- ----------------------------
DROP PROCEDURE IF EXISTS `dodaj_portfel`;
delimiter ;;
CREATE PROCEDURE `dodaj_portfel`(IN `vID_klienta` int, IN `vNazwa_portfela` varchar(100), IN `vTyp_portfela` varchar(50))
BEGIN 
	DECLARE vSaldo DECIMAL(15, 2) DEFAULT 0.00;
	DECLARE vData_otwarcia DATE DEFAULT 0;
	SET vData_otwarcia = CURRENT_DATE;
	INSERT INTO Portfele_inwestycyjne(ID_klienta, Nazwa_portfela, Typ_portfela, Saldo_portfela, Data_otwarcia)
	VALUES(vID_klienta, vNazwa_portfela, vTyp_portfela, vSaldo, vData_otwarcia);
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for dodaj_pracownika
-- ----------------------------
DROP PROCEDURE IF EXISTS `dodaj_pracownika`;
delimiter ;;
CREATE PROCEDURE `dodaj_pracownika`(IN `vStanowisko` varchar(50), IN `vLogin` varchar(50),IN `vHaslo` varchar(255),IN `vImie` varchar(50),IN `vNazwisko` varchar(50), IN `vData_urodzenia` date, IN `vAdres_email` varchar(100), IN `vPanstwo` varchar(80),IN `vMiasto` varchar(50),IN `vKod_pocztowy` varchar(10),IN `vUlica` varchar(50),IN `vNr_budynku` varchar(10),IN `vNr_lokalu` varchar(10))
BEGIN
	DECLARE id_adresu INT(11);
	
	SET id_adresu = dodaj_adres(vPanstwo, vMiasto, vKod_pocztowy, vUlica, vNr_budynku, vNr_lokalu);
	
		if(char_length(vLogin)>0 and char_length(vHaslo)>0 and char_length(vImie)>0 and char_length(vNazwisko)>0 and char_length(vAdres_email)>0 and char_length(vPanstwo)>0 and char_length(vMiasto)>0 and char_length(vKod_pocztowy)>0 and char_length(vUlica)>0) then
	INSERT INTO Pracownicy (Stanowisko, Login, Haslo, Imie, Nazwisko, ID_Adresu, Data_urodzenia, Adres_email) VALUES (vStanowisko, vLogin, vHaslo, vImie, vNazwisko, id_adresu,
											 vData_urodzenia, vAdres_email);
	end if;
END
;;
delimiter ;

