-- ----------------------------
-- Procedure structure for losowa_cena_dla_wszystkich_instrumentow
-- ----------------------------
DROP PROCEDURE IF EXISTS `losowa_cena_dla_wszystkich_instrumentow`;
delimiter ;;
CREATE PROCEDURE `losowa_cena_dla_wszystkich_instrumentow`()
BEGIN
	#W FOR LOOPIE UZYWAC PROCEDURY zaktualizuj_cene
    DECLARE i INT DEFAULT 1;
    DECLARE liczba_instr INT;
		DECLARE cena INT;

    SELECT COUNT(*) INTO liczba_instr FROM Instrumenty_finansowe;
		
    WHILE i <= liczba_instr DO
        CALL zaktualizuj_cene(i, losuj() * (SELECT Cena_aktualna FROM Instrumenty_finansowe WHERE ID_instrumentu = i), NOW());
        SET i = i + 1;
    END WHILE;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for losuj
-- ----------------------------
DROP FUNCTION IF EXISTS `losuj`;
delimiter ;;
CREATE FUNCTION `losuj`()
 RETURNS double
BEGIN
    DECLARE x DOUBLE;
    SET x = (1 + ((6 * RAND() - 3) / 100));
    RETURN x;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for oblicz_sume_sald_portfeli
-- ----------------------------
DROP FUNCTION IF EXISTS `oblicz_sume_sald_portfeli`;
delimiter ;;
CREATE FUNCTION `oblicz_sume_sald_portfeli`(IN vID_klienta INT)
 RETURNS decimal(15,2)
BEGIN
	DECLARE suma_calkowita DECIMAL(15, 2) DEFAULT 0;
	SELECT SUM(Saldo_portfela) INTO suma_calkowita FROM Portfele_inwestycyjne WHERE ID_klienta = vID_klienta;

	RETURN suma_calkowita;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for zaktualizuj_cene
-- ----------------------------
DROP PROCEDURE IF EXISTS `zaktualizuj_cene`;
delimiter ;;
CREATE PROCEDURE `zaktualizuj_cene`(IN `vID_instrumentu` INT(11), 
    IN `vCena` DECIMAL(15,2), 
    IN `vData` DATETIME)
BEGIN
    UPDATE Instrumenty_finansowe
    SET Cena_aktualna = vCena, Data_aktualizacji_ceny = vData
    WHERE ID_instrumentu = vID_instrumentu;
END
;;
delimiter ;

-- ----------------------------
-- Event structure for Aktualizuj cene
-- ----------------------------
DROP EVENT IF EXISTS `Aktualizuj cene`;
delimiter ;;
CREATE EVENT `Aktualizuj cene`
ON SCHEDULE
EVERY '1' HOUR STARTS '2024-06-19 11:00:00'
COMMENT 'Zmienna EventScheduler jest OFF'
DO BEGIN
	CALL losowa_cena_dla_wszystkich_instrumentow();
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table Instrumenty_finansowe
-- ----------------------------
DROP TRIGGER IF EXISTS `after_instrument_update`;
delimiter ;;
CREATE TRIGGER `after_instrument_update` BEFORE UPDATE ON `Instrumenty_finansowe` FOR EACH ROW BEGIN
    INSERT INTO Historia_cen_instrumentow (
        ID_instrumentu, 
        Data,
				Cena
				) 
		VALUES (
        OLD.ID_instrumentu, 
				OLD.Data_aktualizacji_ceny, 
        OLD.Cena_aktualna
    );
		
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table Transakcje
-- ----------------------------
DROP TRIGGER IF EXISTS `aktualizuj_saldo_po_transakcji`;
delimiter ;;
CREATE TRIGGER `aktualizuj_saldo_po_transakcji` AFTER INSERT ON `Transakcje` FOR EACH ROW BEGIN
    DECLARE nowe_saldo DECIMAL(15, 2);

    IF NEW.Typ_transakcji = 'Kupno' THEN
        SET nowe_saldo = (SELECT Saldo_portfela FROM Portfele_inwestycyjne WHERE ID_portfela = NEW.ID_portfela) - (NEW.Cena * NEW.Ilosc);
    ELSEIF NEW.Typ_transakcji = 'Sprzedaż' THEN
        SET nowe_saldo = (SELECT Saldo_portfela FROM Portfele_inwestycyjne WHERE ID_portfela = NEW.ID_portfela) + (NEW.Cena * NEW.Ilosc);
    END IF;

    IF nowe_saldo < 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Saldo nie moze byc ujemne';
    ELSE
        UPDATE Portfele_inwestycyjne SET Saldo_portfela = nowe_saldo WHERE ID_portfela = NEW.ID_portfela;
    END IF;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
